import { SafeAreaView, Text } from 'react-native';


export default function Information() {
  return (
    <SafeAreaView>
          <Text>Hey,</Text>
          <Text>Login Now.</Text>
        <View>
          <Text>If you are new /</Text>
          <Text>Craete New</Text>
        </View>
    </SafeAreaView>
  );
}
